import React from 'react';
import ReactDOM from 'react-dom';
import './dynamicForm.css';

export default class dynamicForm extends React.Componet{

	constructor(props){
		super(props);
	}
	render(){
		let title = this.props.title || 'Dyanmic Form';

		return(
			<div className='form'>
				<h1>{title}</h1>
			</div>
		);
	}
}
